import React from "react";

import { Router, Route, RouteHandler } from "react-router";
import { Link, useHistory } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import Toolbar from "react-minimalist-toolbar";
import { ProgressBar, Button } from "react-bootstrap";
import ServerTable from "react-strap-table";
import { React15Tabulator } from "react-tabulator";
import "react-tabulator/lib/css/bootstrap/tabulator_bootstrap.min.css";
import { Buton, FormGroup, FormControl, FormLabel } from "react-bootstrap";
import { useState } from "react";

const [date, setDate] = useState("");
const [tip, setTip] = useState("");

const columns = [
  { title: "Naziv", field: "name", width: 150, align: "left" },
  {
    title: "avgOcena",
    field: "avgRate",
    align: "center",
    headerFilter: "input",
  },
  { title: "Adresa", field: "adress", align: "center" },
  { title: "Cena", field: "price", align: "center" },
];
const data = [
  {
    name: "Ime klinike",
    avgRate: 4.8,
    adress: "strazilovska 4",
    price: "4160",
  },
];

class clinicList extends React.Component {
  state = {
    data: [],
  };
  ref = true;
  handleClick() {
    const history = useHistory();
    alert("stisnuto");
    history.push("/home_patient");
  }

  
  rowClick = (e, row) => {
    console.log("ref table: ", this.ref.table); // this is the Tabulator table instance
    console.log("rowClick id: ${row.getData().id}", row, e);
    //const history = useHistory();
    alert("stisnuto");
    //history.push("/home_patient");
  };

  setData = () => {
    this.setState({ data });
  };

  clearData = () => {
    this.setState({ data: [] });
  };
  handleClick() {
    try {
      alert("stisnuto");
    } catch (e) {
      alert(e.message);
    }
  }

  render() {
    const options = {
      height: 150,
      movableRows: true,
    };
    return (
      <div className="App">
        <div className="App-home">
          <Toolbar logo={logo} brand="InfoKC" className="toolbar"></Toolbar>
          <p></p>
          <p></p>
          <p className="App-p">Pretraga klinika</p>
          <div bgColor="transparent" className="Div-vertical">
            <div className="Div-horizontal">
              <FormGroup controlId="email" bsSize="large">
                <FormLabel className="App-label">Datum</FormLabel>
                <FormControl
                  autoFocus
                  type="date"
                  value={date}
                  onChange={(e) => setDate(e.target.value)}
                />
              </FormGroup>
              <FormGroup controlId="tip" bsSize="large">
                <FormLabel className="App-label">Tip</FormLabel>
                <FormControl
                  value={tip}
                  onChange={(e) => setTip(e.target.value)}
                  type="tip"
                />
              </FormGroup>
              <p></p>
              <p></p>
              <p></p>
              <p></p>
              <Button
                block
                bsSize="large"
                disabled={!validateForm()}
                type="submit"
              >
                Login
              </Button>
            </div>
            <React15Tabulator
              columns={columns}
              data={data}
              rowClick={this.rowClick}
              data-custom-attr="test-custom-attribute"
              className="custom-css-class"
            />
          </div>
        </div>
      </div>
    );
  }
}
export default clinicList;
